    [],nt"num_tags": 0,nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-time0ecde",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0117059 includes time series
    data collected from MOORINGS in the North Atlantic Ocean from 2010-11-27 to 2013-02-18
    and retrieved during cruise Cres20101127 and Cres20120229. These data include AIR-SEA
    DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT
    SATURATION, Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial
    pressure (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE.
    The instruments used to collect these data include Bubble type equilibrator for
    autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
    data were collected by Adrienne Sutton, Christopher Sabine and Stacy Maenner of
    US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the Mooring_Crescent_64W_32N_Feb2012_Feb2013
    and Mooring_Crescent_64W_32N_Nov2010_Feb2012 data set.nnThe Global CO2 Time-series
